--

CREATE FUNCTION public.add_column_to_all_tables(column_name text) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
table_record RECORD;
BEGIN
FOR table_record IN
SELECT table_name FROM information_schema.tables WHERE table_schema = 'public'
LOOP
EXECUTE format('ALTER TABLE %I ADD COLUMN %I TIMESTAMP DEFAULT CURRENT_TIMESTAMP', table_record.table_name, column_name);
END LOOP;
END;
$$;


